                'slug' => '1996-fender-stratocaster-richie-sambora-signature-in-crimson-red-metallic',
            'description' => '<p><span id="docs-internal-guid-b768ec19-7fff-af35-0158-9075a2755804"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Richie Sambora Stratocaster, made in Mexico, in production between 1994 and 2002, features a Floyd Rose II Double Locking 2-point Tremelo Bridge and DiMarzio® Custom PAF Pro humbucking bridge pickup, and two DiMarzio® special design Single Coil pickups. Unlike the first American Series, it features a 21-fret rosewood fingerboard without the “star” markers, and a simple four-bolt neck plate without micro-tilt. It also does not have the mini-switch and MDX circuit.</span></span></p><p><span id="docs-internal-guid-b768ec19-7fff-af35-0158-9075a2755804"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-b768ec19-7fff-af35-0158-9075a2755804"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-541d2f43-7fff-cd91-baed-424de90d6098"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar came to us from the original single owner as part of a collection being downsized. It is in very good plus (VG+) condition with no breaks or repairs of any kind. All electronics are 100% original to this guitar and work perfectly, as they should. The finish is in excellent condition with only the finest of polishing swirl-marks which are only visible from a very close distance and only in the “wrong” lighting angle. There is one small 1-mm chip on the paint on the rear end inner edge just below the strap button as shown in our pictures. The neck is straight with very little relief, and the strings are setup with very low action and no fret buzz. The truss rod works properly in both directions, and the frets have lots of life left in them; this guit