            'text' => '<p><span id="docs-internal-guid-9de26e4a-7fff-edc3-bac8-6c196bacc0a5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Richie Sambora is a revered rock artist who emerged in the mid 1980’s as Bon Jovi’s lead guitarist and it was clear that Fender was interested in him, for as early as 1991 he appeared in Fender’s frontline. In 1993 Fender unveiled his official signature model, the Richie Sambora Stratocaster. </span></span></p><p><span id="docs-internal-guid-9de26e4a-7fff-edc3-bac8-6c196bacc0a5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-right: -18.2pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663"><span style="font-size: 16px;"><b>1996 Richie Sambora Signature Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Lightweight Poplar body is incredibly comfortable to play over long gigs and extremely resonant with long sustain and thick warm tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Maple Neck with Rosewood fingerboard; focused mid-range, crisp