                'name_2' => 'Fender Stratocaster ‘Jeff Beck’ Signature Strat Plus Dlx, Vintage White, 1991',
                'slug' => '1991-fender-stratocaster-plus-jeff-beck-signature-in-vintage-white-finish',
                'description' => '<p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">In 1990 Jeff Beck took up Fender\'s offer to create a Stratocaster to his preferred specs and they ardently released the long awaited Jeff Beck Signature guitar which was based on the new Strat Plus design. Jeff’s main request was for a really huge neck, and Fender was happy to comply; the 1990−1991 Stratocaster Plus “U” shaped neck aka “the baseball bat” neck was perfect for Jeff’s playing style and is ideal for players with large hands and players that tend to keep their thumb on the back of the neck.</span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This model features a TBX lower tone control, Gold Lace Sensor “Dually” Humbucker pickup in the bridge position, Gold Lace Sensors in the neck and middle positions, and S-1 switching circuit which splits the humbucker by deactivating the Gold Lace sensor nearest to the bridge for more traditional Stratocaster bridge single coil output. The Standard Strat Plus’ Gold Lace Sensor pickups, were designed to give a 50\'s single coil sound, with a lot of chime and even bell like tones. Crisp and quiet, they perform like a 1950\'s pickup, but with no hum!</span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Other Jeff Beck Stratocaster Plus appointments include the premier Wilkinson "roller-nut" and the Sperzel Locking tuners, which work in concert with the American two-point floating bridge with strings going through the body, to maintain excellent tuning stability.</span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-69dbc6c2-7fff-2d78-a91d-d80cac98aeba"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in good overall condition and all electronics are 100% original to this guitar which work perfectly, as they should. This guitar does exhibit small stress cracks on each side of the neck cavity which is an ailment common to these period Stratocasters, however does not affect stability.</span></span></span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-69dbc6c2-7fff-2d78-a91d-d80cac98aeba"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-69dbc6c2-7fff-2d78-a91d-d80cac98aeba"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-a5d2027b-7fff-54fa-eaaf-5509caec1647"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This 30-year old guitar has been played and lovingly carted for, but the finish does exhibit her share of small nicks and dings on the lower edge, but no belt buckle rash or worming on the back side as shown in our pictures. The neck is straight with very little relief, and the strings are setup with very low action and no fret buzz. The truss rod works properly in both directions, and the polished frets have lots of life left in them.</span></span></span></span></span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-69dbc6c2-7fff-2d78-a91d-d80cac98aeba"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-a5d2027b-7fff-54fa-eaaf-5509caec1647"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></span></span></span></span></span></span></p><p><span id="docs-internal-guid-11c0f18d-7fff-bcca-01ab-e5aa245b48b3"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0d3ce9b0-7fff-dc02-d025-8139a1f9ab41" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-fc8f9492-7fff-08f3-7e5c-2578d19e191e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-69dbc6c2-7fff-2d78-a91d-d80cac98aeba"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-a5d2027b-7fff-54fa-eaaf-5509caec1647"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-37fd1556-7fff-7595-f00e-184c606027d9"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar includes the original hardshell case which shows signs of road wear but is structurally intact and all the Fender supplied literature and case candies. The exterior of the case shows road-wear but the interior is in excellent condition.</span></span><br></span></span><br></span></span><br></span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-7716b390-7fff-492b-263a-0534cbe5a05c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Fender Stratocaster Plus&nbsp;Series was introduced by Fender in 1987&nbsp;and was the highest end production model available next to Fender\'s Custom Shop guitars, until production was stopped in July of 1998.</span></span></p><p><span id="docs-internal-guid-7716b390-7fff-492b-263a-0534cbe5a05c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-top:0pt;margin-bottom:0pt;"><span style="font-weight: bolder; color: rgb(0, 0, 0); letter-spacing: 0.4992px;"><span style="font-size: 16px;"><font color="#ffd663">1991&nbsp;</font></span></span><font color="#ffd663"><span style="font-size: 16px;"><b>Jeff Beck Stratocaster Plus at a glance</b></span></font><br></p><p><span id="docs-internal-guid-7716b390-7fff-492b-263a-0534cbe5a05c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Lightweight Poplar body is incredibly comfortable to play over long gigs and extremely resonant with long sustain and thick warm tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom Jeff Beck maple “U” profile neck with Rosewood fingerboard; focused mid-range, crisp highs and smooth playing feel&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Wilkinson Roller Nut</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Sperzel Locking tuners</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American two-point floating bridge string-though body</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">HSS Configuration; Gold Lace Sensor “Dually” Humbucker pickup in the bridge position, and Gold Lace Sensor singlecoils in the neck and middle positions give a 50\'s single coil sound with no 60-cycle hum</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">S-1 switching for bridge pickup and TBX circuit tone control</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Original Hardshell Case included</span></p></li></ul><p><span><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"></span></span><br></p>',
