            array (
                'id' => '31',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-AE90JJQZP5',
                'name' => '2016 FENDER AMERICAN ELITE THINLINE TELECASTER IN NATURAL FINISH',
                'name_2' => 'Fender Telecaster American Elite Thinline, Natural Maple, 2016',
                'slug' => '2016-fender-american-elite-thinline-telecaster-in-natural-finish',
            'description' => '<p><span id="docs-internal-guid-9dfc47b5-7fff-fa39-658a-6d4b6188d921"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Outside of its lightweight ash body, semi-hollow construction and satin finish maple neck, just about everything else on the Elite Telecaster Thinline is completely modified for feel and upgraded for performance and tone. Among the many improvements include its’ perfectly carved, compound “C” neck shape that subtly tapers to a comfortable “D” profile as you climb the neck, a 9.5−to 14-inch compound radius fingerboard that makes fretting out impossible, and an asymmetrical neck heel that feels unobtrusive when playing in the upper register.</span></span></p><p><span id="docs-internal-guid-9dfc47b5-7fff-fa39-658a-6d4b6188d921"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-9dfc47b5-7fff-fa39-658a-6d4b6188d921"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-06405ace-7fff-1941-a752-7fc6123a6c32" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Other beneficial features are the guitar’s dual action truss rod with easy access spoke wheel, which makes adjusting neck relief a no hassle affair, and the inclusion of short-post locking tuners. The Thinline also forgoes the traditional tele bridge plate with a screwless mount suspension bridge with intonatable brass saddles for increased string vibration, which results in more sustain and top end response, in addition to top loaded string changing. The guitar features fourth generation Noiseless pickups combined with Fender’s popular S-1 switching (push-activated atop the volume control), which engages series or parallel wiring options, master tone control and a three-position switch.</span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-6919e4cb-7fff-81d4-cff0-dff04125b6d8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender says: The Fender American Elite Telecaster Thinline, blends all the cosmetics of a traditional Telecaster Thinline, along with cleverly infused modern tweaks that make it not only incredibly versatile, but the only guitar you’ll ever want to play.</span></span></p><p><span id="docs-internal-guid-6919e4cb-7fff-81d4-cff0-dff04125b6d8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin: 0pt -18.2pt 8pt 18pt;"><font color="#ffd663"><span style="font-size: 16px;"><b>American Elite Thinline Telecaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Lightweight ash body, semi-hollow construction is incredibly loud and vibrant.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Elite Telecaster Thinline’s asymmetrical neck heel combined with the compound neck profile allows for effortless feel and stress-free playability.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender’s new 4th generation Noiseless pickups dazzle at blending dead-quiet operation with powerful twangy tones.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Innovative S-1 switching system allows you to combine the pickups in all sorts of different ways, yielding contrasting sounds.&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Screwless mount suspension bridge with intonatable brass saddles increases string vibration, which results in more sustain and top end response.&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:8pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Comes with Fender Deluxe Molded Hardshell Case w/locking center latch</span></p></li></ul><p><span id="docs-internal-guid-6919e4cb-7fff-81d4-cff0-dff04125b6d8"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-fb0dd7e4-7fff-b220-a5a7-1c5b831155a9"></span></span></span><br></p>',
