                'id' => '30',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-KZXGWTQLUD',
                'name' => '2015 FENDER STARCASTER MODERN PLAYER IN AGED CHERRY BURST FINISH',
                'name_2' => 'Fender Starcaster Aged Cherry Burst, 2015',
                'slug' => '2015-fender-starcaster-modern-player-in-aged-cherry-burst-finish',
                'description' => '<p><span id="docs-internal-guid-a7cbc025-7fff-3b29-e98e-74129c8d742a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Back in the 1970s, Starcaster was Fender`s attempt to get into the semi-hollow guitar story to compete with Epiphone and Gibson. The history has proven the rule of Epi and Gibson could not be challenged, but Starcaster made quite a few fans out there. Today, in 2010s, fans of this cult model have a big reason to rejoice, with the return of the legendary Starcaster.</span></span></p><p><span id="docs-internal-guid-a7cbc025-7fff-3b29-e98e-74129c8d742a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-a7cbc025-7fff-3b29-e98e-74129c8d742a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cb6a8c73-7fff-670a-cd89-3dd694ac1433"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Starcaster model is semi-hollow, double-cut and made of laminated maple. The center block is made of alder. Top panel is bound and carved with a pair of "f" holes. Two-piece bridge is made up of the adjust-o-matic bridge in the front and a stop-tail bar in the back. A pair of active humbuckers is featured in the front and their controls unit contains separate volume and tone knobs. Pickups switch is a three-way toggle switch. Maple-made neck sports a C contour in the back and a 22-fret maple fingerboard on it`s top. 22 medium jumbo frets, 1.65" wide synthetic bone nut and 9.50" radius complete the fingerboard.</span></span></span></span></p><p><span id="docs-internal-guid-a7cbc025-7fff-3b29-e98e-74129c8d742a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cb6a8c73-7fff-670a-cd89-3dd694ac1433"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-a7cbc025-7fff-3b29-e98e-74129c8d742a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cb6a8c73-7fff-670a-cd89-3dd694ac1433" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-7b33c848-7fff-9a61-9cf2-c3790e327d3f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom made form-fit hardshell case is included. You can be the first person to play this awesome guitar!</span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-aab33513-7fff-77be-0928-7384bad3dd71"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Fender Starcaster is a part of the Modern Player series, and it features some new updates that make it more usable for today’s player. Famous Artists that play the Starcaster - Radiohead’s Jonny Greenwood, Phish’s Trey Anastasio, The Killers’ Dave Keuning and Arctic Monkeys’ Jamie Cook.</span></span></p><p><span id="docs-internal-guid-aab33513-7fff-77be-0928-7384bad3dd71"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-size: 16px;"><font color="#ffd663">Starcaster Semi-hollowbody at a glance</font></span></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Semi-hollow figured Maple body provides excellent projection and sustain&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Beautiful Hi-Gloss Nitrocellulose Aged Cherry Burst finish</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender Wide Range Humbuckers with Fender Exclusive CuNiFe™ Magnets delivers rich bell-like humbucking tone with full bass and clear treble</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Adjust-o-matic Bridge in the front and a stop-tail bar tailpiece provide excellent tuning and intonation stability</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom form-fit hardshell case is included</span></p></li></ul><p><span id="docs-internal-guid-aab33513-7fff-77be-0928-7384bad3dd71"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-d2a940ae-7fff-c0d0-29a5-6033f523e285"></span></span></span><br></p>',
