                'name_2' => 'Fender \'California Series\' T-Bucket 300-CE 3TS, 3-Tone Sunburst, 2014',
                'slug' => '2014-fender-california-series-t-bucket-300-ce-3ts-acoustic-in-three-tone-sunburst-finish',
            'description' => '<p><span id="docs-internal-guid-b8c602a0-7fff-9d8e-0bba-1f1efba7037b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Fender T-Bucket 300CE would be a classic dreadnought if it weren’t for the single cutaway. This feature makes it particularly suited for those who have already been playing for a while, and like to use the higher-end strings. The excellent choices of material; with maple for top, mahogany for back, sides and neck, and rosewood for bridge and fretboard make this guitar a sonic workhorse. The back and sides of the Fender T-Bucket are laminated mahogany, making it fairly sturdy and able to weather some (chance) punishment. The top is flame maple, also known as tiger maple due to its distinctive tiger-stripe pattern. As with any maple though, this top creates an overly bright sound, which is very well tempered by the mahogany body. As noted, the neck is mahogany-made, which, coupled with rosewood fretboard, contributes to the sound with complex highs, and thick and creamy lows for an overall well-rounded sound.</span></span></p><p><span id="docs-internal-guid-b8c602a0-7fff-9d8e-0bba-1f1efba7037b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-b8c602a0-7fff-9d8e-0bba-1f1efba7037b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bbe12963-7fff-c34b-39fc-51dafad2c9f5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Fishman® Isys III System Onboard Preamp System is designed to offer maximum control, performance and quality in a small, unobtrusive format. The compact and sophisticated Isys III System offers Volume, Bass, Mid, Treble controls, and a built-in tuner with LED display. The Isys III System also includes a pre-wired Fishman Sonicore pickup for solder-free, plug and play installation, a low battery indicator, low profile control knobs and a unique pivot design for easy access to the battery compartment.</span></span></span></span></p><p><span id="docs-internal-guid-b8c602a0-7fff-9d8e-0bba-1f1efba7037b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bbe12963-7fff-c34b-39fc-51dafad2c9f5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-b8c602a0-7fff-9d8e-0bba-1f1efba7037b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bbe12963-7fff-c34b-39fc-51dafad2c9f5" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-89692977-7fff-e9ad-404b-fce78ef4bad5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is unplayed condition and was unboxed for display in an enclosed display case only. By default no case or gigbag is included by Fender. Felicity’s Guitars provide a custom ordered Black Tolex Hardshell Case – included in price at our cost.</span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-e15ae5c6-7fff-02f5-ee5b-4ac7e1d1bc4f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">2014 Fender California Series “T-Bucket” guitar is beautiful, and, more importantly, it has a personality to match! The tone is medium, neither deep resonating nor twangy. The mahogany back and sides do a great job of tempering the brightness of the maple top, resulting in a much warmer and thicker sound.</span></span></p><p><font color="#ffd663"><span id="docs-internal-guid-e15ae5c6-7fff-02f5-ee5b-4ac7e1d1bc4f" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span><span style="font-size: 0.875rem; letter-spacing: 0.0312rem;">“T-Bucket” 300-CE-3TS Acoustic at a glance</span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Laminated mahogany back and sides with Flamed Maple top</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Quartersawn Scalloped “X” Bracing</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Mahogany neck and Rosewood bridge and fingerboard</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Graphtech Nubone Compensated saddle</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fishman Isys III System with Active On-board Preamp and Tuner</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">California Series Pinstriped Rosette, 12</span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="vertical-align: super;">th</span></span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"> fret Marker and Headstock</span></p></li></ul><p><span id="docs-internal-guid-e15ae5c6-7fff-02f5-ee5b-4ac7e1d1bc4f"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-var