            'name_2' => 'ESP U.S.A. ‘Ron Wood’ Signature Telecaster (TE), Ltd, Glossy Black, 2010',
                'slug' => '2010-esp-japan-ron-wood-signature-tele-in-black-finish',
                'description' => '<p><span id="docs-internal-guid-9f9a184e-7fff-46f9-d518-b062ce278127"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Holding its own among&nbsp;Ronnie&nbsp;Wood\'s invaluable collection of classic guitars, the ESP Ron Wood is handcrafted by the expert luthiers at the ESP Custom Shop in Japan for the Rolling Stones\' guitarist of more than 40 years. Seen onstage during nearly every Stones tour of the past 20+ years, the ESP Ron Wood offers a traditional vibe taken to the highest level of tone and playability</span></span></p><p><span id="docs-internal-guid-9f9a184e-7fff-46f9-d518-b062ce278127"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-707050e7-7fff-6678-aba1-3fa8827ae9c8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">A bolt-on neck design, the ESP Ron Wood pairs&nbsp;a comfortable fully-bound alder body to a maple neck with maple fingerboard and 22 jumbo frets. Its sound is powered by an ESP Designed LH-200 humbucker&nbsp;in the neck, and a single-coil&nbsp;ESP TS-120 pickup in the bridge position. It includes a bone nut, Gotoh tuners, and a traditional flat-mount bridge and multi-ply pickguard design. Available in Black finish.</span></span></span></span></p><p><span id="docs-internal-guid-9f9a184e-7fff-46f9-d518-b062ce278127"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-707050e7-7fff-6678-aba1-3fa8827ae9c8" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-dc2c1904-7fff-9243-a32c-eaa36d9c1fba" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The 2010 ESP Japan Signature Series “Ron Wood” Tele comes with an ESP form-fit Hardcase and Certificate of Authenticity.</span></span><br></span></span><br></span></span><br></p>',
                'text' => '<p><span id="docs-internal-guid-ca0a471a-7fff-0718-b1fa-be23923550fc"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Ron Wood is an English rock musician, songwriter, multi-instrumentalist, artist, author, and radio personality best known as a member of the Rolling Stones since 1975, as well as a member of Faces and the Jeff Beck Group. Wood began his career in 1964, when he joined the Birds on guitar.</span></span></p><p><span id="docs-internal-guid-ca0a471a-7fff-0718-b1fa-be23923550fc"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-38d984a0-7fff-330e-0c5c-0bf1eeca74b8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Made at ESP’s Tokyo workshop, ESP’s Ron Wood Signature is a Tele-style guitar with an alder body and bolt-on maple neck and fingerboard. Visually, the Ron Wood features a classic glossy black finish with top and back cream binding. Visually and sonically, the Ron Wood Signature looks and sounds the part of an iconic rock and blues guitar</span></span></span></span></p><p><font color="#ffd663"><span style="font-size: 16px;"><b><br></b></span></font></p><p><font color="#ffd663"><span style="font-size: 16px;"><b>ESP Signature Series “Ron Wood” Tele at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Comfortable fully-bound Alder wood body&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -27.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Quarter-Sawn Maple Satin Finished Neck back, and Gloss Finished Maple fingerboard with 22 jumbo frets</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -27.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">ESP® designed LH-200 humbucker&nbsp;in the neck, and a single-coil&nbsp;ESP® TS-120 pickup in the bridge position&nbsp; provide iconic rock and blues guitar tones&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Gotoh 6-in-line Deluxe Vintage Style Tuners&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Flat-mount Fixed Bridge, Strings-thru-Body with 6 Stainless Steel Block-Saddles</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;