                'description' => '<p>The classic Hummingbird style acoustic guitar first introduced at the legendary Gibson and Epiphone factory in Kalamazoo in 1962 became one of the first acoustic guitars to become a recognized rock and roll icon. Now, both beginners and professionals can enjoy the classic sound of The Hummingbird Pro plugged in with the Epiphone-Shadow™ ePerformer™ Preamp System.</p><p><br></p><p><span id="docs-internal-guid-b7b916be-7fff-421d-ba46-72ff8b405fad"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-d7edd806-7fff-6dd6-03bf-eb013e9c7c81"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-6744b5ca-7fff-991d-5a64-d80ef2341e97"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Hummingbird PRO Acoustic/Electric has a beautiful Faded Cherry Sunburst color finish and features a Solid Spruce top with 5-ply white and black binding. The body back and sides are made from laminated Mahogany for a punchy, bright tone. The hard Mahogany 24.72″ scale neck has a slim taper “D” profile fixed solidly to the body using a Dovetail joint and Titebond™ glue.</span></span></span></span></span></span></p><p><span id="docs-internal-guid-b7b916be-7fff-421d-ba46-72ff8b405fad"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-d7edd806-7fff-6dd6-03bf-eb013e9c7c81"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-6744b5ca-7fff-991d-5a64-d80ef2341e97"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-aa989950-7fff-cc79-3969-c5bc687785cd"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></span></span></span></span></p><p class="MsoNormal" style="text-align:justify;line-height:115%"><b><span lang="EN-US" style="font-size:12.5pt;line-height:115%;color:#FFE599;mso-themecolor:
accent4;mso-themetint:102">Shadow Pickup System</span></b></p><p class="MsoNormal" style="text-align:justify;line-height:115%"><b><span lang="EN-US" style="font-size:12.5pt;line-height:115%;color:#FFE599;mso-themecolor:
