esentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Grover® Rotomatic® 15:1 ratio tuners</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="text-align: justify; line-height: 1.295; margin-right: -22.7pt; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Epiphone-Shadow™ ePerformer™ Preamp System Master Volume, Treble and Bass EQ, Mute, and Dynamic Controls</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom Acoustic hardshell guitar case included</span></p></li></ul><p><span id="docs-internal-guid-3d84178e-7fff-1c64-a315-ae081e9ce70f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-6faf076c-7fff-8658-6fd2-40343b0c7e48"></span></span></span><br></p><p><span id="docs-internal-guid-3d84178e-7fff-1c64-a315-ae081e9ce70f"><span style="font-size: 11pt; font-family: Calibri, sans-serif; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><br></span></span></p>',
