                'brand_id' => '16',
                'code' => 'PRD-516CGQXME9',
                'name' => '2016 ESP U.S.A. TE-II LTD. ED. EXOTIC ZEBRAWOOD IN NATURAL FINISH',
                'name_2' => 'ESP U.S.A. TE-II Exotic Zebra Wood, 15-pc Worldwide Ltd Ed, Natural, 2016',
                'slug' => '2016-esp-usa-te-ii-ltd-ed-exotic-zebrawood-in-natural-finish',
            'description' => '<p><span id="docs-internal-guid-866cb85d-7fff-d59b-dd3f-8a6f80c92f0d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Limited to 15 guitars worldwide, The&nbsp;ESP&nbsp;U.S.A. TE-II Zebrawood is a special limited-edition guitar made at ESP U.S.A.’s shop in North Hollywood, CA. It combines a classic shape with the very best in modern playability, along with some elegant design features that place it among the best guitars in the world. Its mahogany body is topped with highly-figured, black-bound zebrawood, which is also used on its matching headstock. It features a quarter-sawn thin U-shaped maple neck that’s paired with an amazing roasted Birdseye maple fingerboard. This limited-edition ESP U.S.A. TE-II has high-end components that include direct-mount Seymour Duncan Custom and Jazz pickups, with controls that include volume and tone (with a push-pull coil tap), along with a Hipshot hardtail bridge with string-thru-body design, Sperzel locking tuners, and more.</span></span></p><p><span id="docs-internal-guid-866cb85d-7fff-d59b-dd3f-8a6f80c92f0d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-866cb85d-7fff-d59b-dd3f-8a6f80c92f0d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0af448c8-7fff-ff5d-6e9a-53b544f84978"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The ESP U.S.A. Limited Edition TE-II is loaded with a first-rate duo of Seymour Duncan pickups. The TB-5 Trembucker Custom in this guitar is an overwound PAF-like humbucker with prominent upper-mids that give rise to articulate cleans and an airy, focused drive that beautifully enhances the inherent warmth of this guitar\'s tonewoods. The SH-2N Jazz is a bright, vintage-output humbucker with tight lows and scooped mids that sing clearly — even in extreme high-gain situations. And both pickups are coil tapped, providing you with excellent single-coil tones.</span></span></span></span></p><p><span id="docs-internal-guid-866cb85d-7fff-d59b-dd3f-8a6f80c92f0d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0af448c8-7fff-ff5d-6e9a-53b544f84978"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-866cb85d-7fff-d59b-dd3f-8a6f80c92f0d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0af448c8-7fff-ff5d-6e9a-53b544f84978" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8d713164-7fff-2577-fb17-b0d8ae8c9144"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The ESP U.S.A. TE-II Zebrawood comes with an ESP U.S.A. case and certificate of authenticity.</span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-e0ed3fdc-7fff-33ef-7ef5-37c84172fea6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">You\'ll do a triple take when you catch a glimpse of the ESP U.S.A. Limited Edition TE-II solidbody electric guitar, thanks to its exquisite zebrawood drop top and matching headstock. This stunning top isn\'t just about looks, however. It also frames the judicious warmth and sustain provided by this guitar\'s mahogany body with the perfect amount of snap and bite.</span></span></p><p><span id="docs-internal-guid-e0ed3fdc-7fff-33ef-7ef5-37c84172fea6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin: 0pt -18.2pt 8pt 18pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">ESP U.S.A. TE-II Exotic Zebrawood at a glance</span></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Exquisite zebrawood drop top and matching headstock create an eye-catching look</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Carefully selected tonewoods produce warmth, sustain, and the perfect amount of bite</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Seymour Duncan humbuckers yield ample output, an airy sizzle, and clear, singing notes</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Coil tapping provides access to single-coil tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Roasted bird’s-eye maple-topped quartersawn maple neck is super-stable and highly playable</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Extremely Limited edition — only 15 guitars produced worldwide</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Includes handwritten limited-edition number, certificate of authenticity, and build sheet&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">ESP® U.S.A. ‘G&amp;G’ Custom Form-Fit Hardshell Case</span></p></li></ul><p><span id="docs-internal-guid-e0ed3fdc-7fff-33ef-7ef5-37c84172fea6"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-0cbf8509-7fff-69f6-6400-27c2e3a4d7a4"></span></span></span><br></p>',
