            9 => 
            array (
                'id' => '34',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-ZCZGWSLZFK',
                'name' => '2011 FENDER ERIC CLAPTON SIGNATURE “BLACKIE” STRATOCASTER IN GLOSSY BLACK',
                'name_2' => 'Fender Stratocaster ‘Eric Clapton’ Signature “Blackie”, Glossy Black, 2011',
                'slug' => '2011-fender-eric-clapton-signature-blackie-stratocaster-in-glossy-black',
            'description' => '<p><span id="docs-internal-guid-23964d3e-7fff-d18f-69ba-3753d75d27a2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Eric Clapton or “Slowhand” Stratocaster is constructed using tone sustaining alder. The Bridge is a vintage synchronized tremolo that`s been blocked, just like on Slowhand`s Strat. The Pickups are Vintage Noiseless single coils with special electronics. Master volume, two tone knobs and a five-position blade switch complete the controls unit. The Maple neck is profiled with a soft V contour which provides a distinctly comfortable fretting-hand feel that takes the more pronounced sharpness of a ’50s "V" profile and "softens" it into a somewhat more rounded shape.</span></span></p><p><span id="docs-internal-guid-23964d3e-7fff-d18f-69ba-3753d75d27a2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-23964d3e-7fff-d18f-69ba-3753d75d27a2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-227b13e9-7fff-f4f8-9b72-37255506a325"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The first tone control knob operates this guitar’s TBX (Treble Bass Expander) tone circuitry. The knob has a detent at the center position (5) and works like a normal tone control from zero to the detent. Turning the knob clockwise from the detent adds presence and brightness; turning it counterclockwise from the detent rolls off high frequencies. The second tone control knob functions as an active mid-boost control. Turning it clockwise boosts mid and bass frequencies while decreasing treble frequencies. The Eric Clapton Stratocaster comes with an easily removable wood block installed between the tremolo block and tremolo cavity wall to keep it from moving, as specified by the great guitarist himself.</span></span></span></span></p><p><span id="docs-internal-guid-23964d3e-7fff-d18f-69ba-3753d75d27a2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-227b13e9-7fff-f4f8-9b72-37255506a325"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-23964d3e-7fff-d18f-69ba-3753d75d27a2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-227b13e9-7fff-f4f8-9b72-37255506a325" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-12702d54-7fff-176f-328d-0d2cea2403b2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in all original and unplayed condition just like when it left the factory (new old stock). The pickguard protective film had some wrinkles due to shrinkage and so we removed the film in order to photograph the guitar more ‘appealingly’. As such, we’re listing this guitar as being in ‘mint’ instead of ‘new’ condition. You can be the first person to play this awesome guitar!</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-8a21916b-7fff-8bee-9f60-f87cee9349b4"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender U.S.A. says - Experience the peerless Strat™ style of Slowhand himself with the Eric Clapton Stratocaster, one of our most acclaimed and enduring artist signature models. With classic design and special features that give it exceptional tonal versatility and effortless feel worthy of one of the world\'s greatest names in rock and blues, it puts pure Clapton Stratocaster tone and feel straight into your hands.</span></span></p><p><span id="docs-internal-guid-8a21916b-7fff-8bee-9f60-f87cee9349b4"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><br></span></span><span style="font-weight: bolder; color: rgb(255, 214, 99); font-size: 16px; letter-spacing: 0.4992px;"><br></span></p><p><font color="#ffd663"><span style="font-size: 16px;"><b>2011 Eric Clapton Signature Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height: 1.295; margin-right: -18.2pt; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Alder body is very tone sustaining and resonates superbly</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Maple neck with satin finish back and Clapton’s favored soft ‘V’ profile fits very comfortably in the hand up and down the fretboard&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage Noiseless™ pickups with Alnico 2 magnets create complex harmonics with warmer attack and less-aggressive midrange&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Master Volume, Tone 1; Master TBX™ Tone Control, Tone 2; Master Active Mid-boost (0-25dB)&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Clapton’s favored vintage-style ‘blocked’ synchronized tremolo bridge like on “Blackie”&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height: 1.295; margin-right: -18.2pt; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender® U.S.A. Vintage Tweed Hardshell Case</span></p></li></ul><p><span id="docs-internal-guid-5255c9ec-7fff-c71d-91cf-e2fc9824dd79"></span><br></p>',
