                'name_2' => 'Fender Jazzmaster American Vintage \'65 Ltd Ed, Vintage Aztec Gold, 2013',
                'slug' => '2013-fender-avri-65-jazzmaster-in-aztec-gold-finish',
            'description' => '<p><span id="docs-internal-guid-c6f00f7d-7fff-d837-467c-b8d0c49d3215"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The American Vintage \'65 Jazzmaster is a classic Alder solidbody electric guitar finished in Aztec Gold glossy lacquer. Vintage Jazzmaster contour and bolt-on neck joints are featured on the body of this model. Bridge section is equipped with an adjust-o-matic bridge in the front, while the tremolo plate base is installed in the back. Pickups are New American Vintage \'65 single coils. They are controlled through an elaborate, but intuitive controls unit. Master volume, master tone, three-way toggle pickups witch and a set of volume and tone switches paired with rhythm/lead slider switch. Maple neck is equipped with a \'60s C contour and topped with a 21-fret true vintage laminated rosewood fingerboard. Dot inlays, 7.25" radius and 1.65" bone nut complete the fingerboard.</span></span></p><p><span id="docs-internal-guid-c6f00f7d-7fff-d837-467c-b8d0c49d3215"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-c6f00f7d-7fff-d837-467c-b8d0c49d3215"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8004f7db-7fff-f89d-3379-a97d94b913b8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar was purchased brand new. When we received it and opened the box for inspection, sadly, the guitar was found to be lying atop the hardshell case key which “mysteriously” managed to escape from the case-pocket during delivery to us. There are a few 2-2.5mm wide chip-like marks in the thin flash-coat finish, the worst of which extends down to the primer-coat. The marks are on the rear inner edge of the body near the strap end-pin and not easily visible from the front – as shown in the pictures. The rest of the guitar is in 100% immaculate and untouched condition.</span></span></span></span></p><p><span id="docs-internal-guid-c6f00f7d-7fff-d837-467c-b8d0c49d3215"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8004f7db-7fff-f89d-3379-a97d94b913b8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-c6f00f7d-7fff-d837-467c-b8d0c49d3215"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8004f7db-7fff-f89d-3379-a97d94b913b8" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-0fe50c37-7fff-190c-f5f1-eb0f26f95d00" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The (AVRI) American Vintage \'65 Jazzmaster comes with a Fender® Vintage Hardshell Case and a wealth of vintage-era case candy.</span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-b0541e2b-7fff-d69e-f88a-679272ea456f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The American Vintage Series offers one of the best lineups of vintage-styled guitars available on the market. The Fender® American Vintage \'65 Jazzmaster is the second Jazzmaster reissue in the American Vintage line, following on the heels of the \'62 Jazzmaster. Models of this line are made with so much care for the detail that every model has its own pickups combo, a feature not seen anywhere else. Also, these models have so much historically accurate features that someone might mistake them for the originals. It`s like Fender® installed time machines on each of these guitars.</span></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-right: -18.2pt;margin-top:0pt;margin-bottom:8pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-right: -18.2pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px;"><b>American Vintage \'65 Jazzmaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American Vintage Series Jazzmaster, based on the design of original 1965 Jazz means beauty, tone, and playability</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage-style Flash Coat Lacquer finish is thinner than modern finishes, allowing the alder body to "breathe" and enhance tonally as it ages</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Mid \'60s C-shaped neck plays fast</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American Vintage \'65 Jazzmaster single-coil pickups, specially wound to period-correct ’65 specs and tone&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Aged plastic knobs and switch caps complete the vintage look</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage Hardshell Case and era-authentic case candies</span></p></li></ul><p><span id="docs-internal-guid-b0541e2b-7fff-d69e-f88a-679272ea456f"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-bc112430-7fff-fa4a-c4f0-0f97b7b9a1e9"></span></span></span><br></p>',
