                'description' => '<p><span id="docs-internal-guid-2d260bc0-7fff-5a63-bc12-2331b11447c7"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Both Thurston Moore and Lee Ranaldo have been seen rocking out with their unique sound holding these guitars. If anybody ought to have signature Jazzmaster models, it’s these two virtuosos. Special features of the Lee Ranaldo Jazzmaster include two Fender Wide Range humbucking pickups re-voiced to original vintage spec, black anodized pickguard, Two new Fender Wide Range humbucking pickups re-voiced to original vintage specs, American Vintage Jazzmaster tremolo with Mustang bridge and tremolo lock button, single master volume control, and a Sapphire Blue Transparent satin nitrocellulose lacquer finish and black-painted headstock, plus a Sonic Youth \'zine and sticker sheet.</span></span></p><p><span id="docs-internal-guid-2d260bc0-7fff-5a63-bc12-2331b11447c7"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-2d260bc0-7fff-5a63-bc12-2331b11447c7"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span style="text-align: justify;">The Lee Ranaldo Jazzmaster comes with a Fender® Deluxe Hardshell Case and a wealth of Case Candy.</span></p>',
