                'slug' => '2013-fender-jazzmaster-thurston-moore-signature-in-satin-forest-green-finish',
                'description' => '<p><span id="docs-internal-guid-1069b67c-7fff-b988-1db5-0a946896aa35"></span></p><p dir="ltr" style="line-height: 1.38; margin: 0pt 0.45pt 8pt 9pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This Jazzmaster comes with a solid alder body. It has no binding or top wood cover. Entire bridge section is, just like the rest of the hardware, plated in chrome. The key Thurston Moore Jazzmaster tweaks include two Seymour Duncan Antiquity II pickups, an Adjust-o-Matic bridge, and a tremolo lock button. Maple neck is bolted to the body and it`s equipped with C contour in the back. Rosewood fingerboard features 21 frets, dot inlays and 1.65" wide synthetic bone nut.</span></p><p dir="ltr" style="line-height: 1.38; margin: 0pt 0.45pt 8pt 9pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></p><p dir="ltr" style="line-height: 1.38; margin: 0pt 0.45pt 8pt 9pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-64782f43-7fff-e25c-cfef-9edf5a0eecaf" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Thurston Moore Jazzmaster comes with a Fender® Deluxe Hardshell Case and a wealth of Case Candy.</span></span><br></span></p>',
                'text' => '<p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">With the Thurston Moore Jazzmaster slung across your shoulder, you can\'t help but feel </span>your independent spirit fuel! </p><p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><br></p><p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-e714cdbe-7fff-9142-76e5-78e0f0601f6f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This eye-catching Forest Green Jazzmaster has been hot-rodded and spec\'d out by none other than Sonic Youth indie rock guitar wiz\', Thurston Moore. Ready to start exploring?</span></span></span></p><p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><br></p><p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-e714cdbe-7fff-9142-76e5-78e0f0601f6f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-6b2ee5d8-7fff-998c-e7f5-ff92a337d73e" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The sonic palette\'s right here: the Fender Thurston Moore Jazzmaster.</span></span></span></span></span></p><p dir="ltr" style="line-height: 1.38; margin: 0pt -18.2pt 0pt 22.5pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-e714cdbe-7fff-9142-76e5-78e0f0601f6f"><span style="font-variant-numeric: normal; font-variant-east-a