                'brand_id' => '13',
                'code' => 'PRD-GOO86YE8NR',
                'name' => '2013 FENDER AMERICAN DELUXE 60TH ANNIVERSARY STRATOCASTER IN SUNSET METALLIC',
                'name_2' => 'Fender Stratocaster American Deluxe SSS 60th Ann, Sunset Metallic, 2013',
                'slug' => '2013-fender-american-deluxe-60th-anniversary-stratocaster-in-sunset-metallic',
                'description' => '<p><span id="docs-internal-guid-b43998ee-7fff-2302-adce-223e8a0d4229"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Tone, tradition and innovation. Fender´s new American Deluxe Stratocaster has all the modern features today´s guitarists require. The compound radius fretboard allows effortless string bending anywhere along the neck, and new N3 Noiseless pickups provide improved Stratocaster tones for sparkling bell-like chime with no hum, moreover the Bridge, Middle and Neck N3 Noiseless pickups have varied Alnico 2, 3 and 5 magnets which produces harmonically complex tonal versatility. Reconfigured S-1™ switching offers other distinctive tonal options, and other features include staggered locking tuners, two-point synchronized American Deluxe Tremolo Bridge with pop-in arm, and beveled neck heel. </span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-477e0523-7fff-18b3-816d-20bff6557676"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Stepping up from the American Standard series, the Fender American Deluxe Stratocaster tacks on a few extra appointments that appeal to higher-end sensibilities.</span></span></p><p><span id="docs-internal-guid-477e0523-7fff-18b3-816d-20bff6557676"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin: 0pt -18.2pt 8pt 22.5pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif" style="font-size: 0.875rem; -webkit-font-smoothing: antialiased; font-feature-settings: &quot;kern&quot;; font-kerning: normal; font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; letter-spacing: normal;"><span style="-webkit-font-smoothing: antialiased; font-feature-settings: &quot;kern&quot;; font-kerning: normal; font-size: 16px; margin-top: 15px;"><span style="-webkit-font-smoothing: antialiased; font-feature-settings: &quot;kern&quot;; font-kerning: normal; font-weight: 700;">2013 American Deluxe 60th Anniversary Stratocaster at a glance</span></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Lightweight Select Alder body is incredibly comfortable to play extremely resonant with long sustain and thick warm tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Modern “C” shaped Maple Neck and fingerboard with smooth playing feel</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Speedy, Maple fingerboard with comfortable hand-rolled edges and 9.5"–14"&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The compound-radius fretboard allows effortless string bending anywhere along the neck</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deluxe two-point Synchronized Tremolo Bridge with pop-in arm&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">N3 Noiseless pickups provide improved Stratocaster tones for sparkling bell-like chime with no hum.</span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"> </span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Alnico 2, 3 and 5 magnets produce&nbsp;</span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">harmonically complex tonal versatility</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Reconfigured S-1™ Push-Push Control allow full control over pickup series/parallel operations for an unlimited tone palette</span></p></li></ul><p><span id="docs-internal-guid-477e0523-7fff-18b3-816d-20bff6557676"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-ef3acd21-7fff-4168-968d-a4b102d56d82"></span></span></span><br></p>',
