            14 => 
            array (
                'id' => '39',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-JSSSHYFJRB',
                'name' => '2013 FENDER STRATOCASTER ‘STEVIE RAY VAUGHAN’ SIG. IN 3-COLOR SUNBURST',
                'name_2' => 'Fender Stratocaster ‘Stevie Ray Vaughan’ Signature 2-Color Sunburst, 2013',
                'slug' => '2013-fender-stratocaster-stevie-ray-vaughan-sig-in-3-color-sunburst',
            'description' => '<p><span id="docs-internal-guid-a046e378-7fff-5973-302c-baabbaa38b14"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Stevie Ray Vaughan`s Stratocaster was one of the most recognizable guitars in the world. Famous "Lenny" was known as Stevie`s No.1 and Stevie`s first wife. This model is a nod to the late legend and his beloved guitar. It comes with a solid body made of alder and oval maple neck. Oval maple neck is equipped with bolt-on joint and 21-fret rosewood fingerboard.</span></span></p><p><span id="docs-internal-guid-a046e378-7fff-5973-302c-baabbaa38b14"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-a046e378-7fff-5973-302c-baabbaa38b14"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-084b7c58-7fff-7536-7f50-5f6cb883252d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Body is flat and it features a black pickguard on top against the 3-Color Sunburst color scheme. Finish is done in gloss. Bridge is a gold-plated tremolo for left-handed guitars. Vaughan is said to have preferred the left-handed (or upside-down) tremolo because its placement on a right-handed guitar was more like the arrangement used by Jimi Hendrix—with the trem arm above the strings rather than below them. Three Texas Special single coil pickups are installed in front of the bridge. Control knobs are, like pickups, white, while the tuners and bridge are plated in gold.</span></span></span></span></p><p><span id="docs-internal-guid-a046e378-7fff-5973-302c-baabbaa38b14"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-084b7c58-7fff-7536-7f50-5f6cb883252d"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-a046e378-7fff-5973-302c-baabbaa38b14"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-084b7c58-7fff-7536-7f50-5f6cb883252d" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-ea1b8806-7fff-9767-7824-10440175511a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deluxe “tweed” hardshell case is included. We just removed the wrinkled protective plastic film from the pickguard to take more aesthetic photographs. This guitar is in brand new, 100% unplayed condition, and you can be the first person to play it!</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-93e80588-7fff-fa00-577d-2e577a108c47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender U.S.A. says — if there were a Mount Rushmore of the Stratocaster, Stevie Ray Vaughan would be one of the greats enshrined there. Fender\'s Stevie Ray Vaughan Stratocaster is a finely crafted like-new version of Vaughan\'s favorite guitar—the famous "Number One" Strat® with which he electrified listeners everywhere and seared scorching Texas blues into the top of the charts. For pure SRV tone and style that evokes one of the Stratocaster\'s most revered masters, this is the "One."</span></span></p><p><span id="docs-internal-guid-93e80588-7fff-fa00-577d-2e577a108c47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Stevie Ray Vaughan Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Early-’60s thick oval “C” neck profile like Stevie’s famous “Number One”&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Pau Ferro fingerboard with 6105 tall &amp; narrow frets like Stevie preferred</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Three Fender® Custom Shop Texas Special Singlecoil Strat pickups</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Classic and stylish SRV engraved pickguard</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">All Gold-plated hardware</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Reverse vintage-style ‘lefty” tremolo bridge ala “Hendrix” style just like Stevie rocked&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deluxe “tweed” hardshell case included</span></p></li></ul><p><span id="docs-internal-guid-93e80588-7fff-fa00-577d-2e577a108c47"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-6e2f2762-7fff-1e4e-ea96-5c56ca7795d2"></span></span></span><br></p>',
