            array (
                'id' => '40',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-EV2848YBO4',
                'name' => '2013 FENDER TELECASTER STANDARD SPECIAL EDITION IN SATIN ARIZONA SUN FINISH',
                'name_2' => 'Fender Telecaster Standard, Candy Orange Metallic Satin, 2013',
                'slug' => '2013-fender-telecaster-standard-special-edition-in-satin-arizona-sun-finish',
                'description' => '<p><span id="docs-internal-guid-76e40e81-7fff-c832-04d9-cc6c350159c6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Fender Standard Telecaster is based on one of the most popular guitar models of all time. So what\'s the difference between guitars from Corona, CA and Ensenada, Mexico? Is it simply the 180 miles that separate the two factories? Think what you may, but the Tele has always been a workhorse, and the made-in-Mexico Fender Standard Telecaster is the epitome of a workhorse guitar: simple, effective, affordable.</span></span></p><p><span id="docs-internal-guid-76e40e81-7fff-c832-04d9-cc6c350159c6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-76e40e81-7fff-c832-04d9-cc6c350159c6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-343d6424-7fff-ebcd-f32d-64e40d90958c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Designed for comfort and playability, as well as stunning style, the Fender Select Edition Standard Telecaster is truly “eye-candy”. Featuring a lightweight Alder body, the Standard Telecaster is ideal for long playing sessions. Authentic "Tele" tone with the extra-wound hotter Single-Coil Tele Neck and Bridge Pickups will cut through any mix.</span></span></span></span></p><p><span id="docs-internal-guid-76e40e81-7fff-c832-04d9-cc6c350159c6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-343d6424-7fff-ebcd-f32d-64e40d90958c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-76e40e81-7fff-c832-04d9-cc6c350159c6"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-343d6424-7fff-ebcd-f32d-64e40d90958c" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-03457196-7fff-8222-1c5c-af1189d1cd69" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Includes a “Special Edition” decal on the rear of the headstock and Fender® Gig Bag.&nbsp; We include a Custom Tweed Strat®/Tele® Hardshell Case with lock. </span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-0b86bf08-7fff-77d2-f39c-3f414a60f64b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Classic Tele Design, Hotter Tones, Satin Finish. The Fender Standard Telecaster Satin solidbody electric guitar gives you that classic Tele sound and feel you know and love, and adds some very cool improvements for modern players! The Standard Telecaster Satin sports a pair of single-coil pickups voiced a bit hotter than standard, which works very well when you\'re cranking up for distorted tones. The wiring cavities are now shielded, giving you a big reduction in hum and quieter operation. This Tele features an alder body with satin finish, a maple neck, rosewood fingerboard, and chrome hardware. Medium-jumbo frets make the Standard Telecaster Satin easier to play than ever.</span></span></p><p><span id="docs-internal-guid-0b86bf08-7fff-77d2-f39c-3f414a60f64b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:8pt;"><span style="color: rgb(255, 214, 99); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px; font-weight: bolder; letter-spacing: normal;">Fender “Special Edition” Standard Telecaster at a glance</span></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Comfortable and lightweight Alder body provides great resonance and presence</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Select Edition limited production Satin Metallic finish will stand out on stage.&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Authentic "Tele" tone with the extra-wound, hotter Single-Coil Tele Neck and Bridge Pickups will cut through any mix.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Shielded Cavities</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">"Special Edition" decal on the rear of the headstock</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom U.S.A. upgrades; Paisley pickguard, control knobs and hardshell case included</span></p></li></ul><p><span id="docs-internal-guid-0b86bf08-7fff-77d2-f39c-3f414a60f64b"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-5a573dd2-7fff-a41d-3241-fc6bdf6a50d7"></span></span></span><br></p>',
