                'brand_id' => '13',
                'code' => 'PRD-8JBNYRX21P',
                'name' => '2014 FENDER LIMITED EDITION 60TH ANNIVERSARY AMERICAN SPECIAL STRATOCASTER IN BLACK',
                'name_2' => 'Fender Stratocaster American Special HSS 60th Ann, Glossy Black, 2014',
                'slug' => '2014-fender-limited-edition-60th-anniversary-american-special-stratocaster-in-black',
                'description' => '<p><span id="docs-internal-guid-0f8a3de4-7fff-37a0-1e71-ffcd3ced9276"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">To honor the 60th anniversary of the Stratocaster in 2014, the U.S.-made American Special Stratocaster is available in a sultry all-black limited edition model. An ideal instrument for the Stratocaster player with a dark side, the Limited Edition American Special Stratocaster has all the great American Special features, such as Texas Special™ pickups and a Greasebucket™ tone circuit, but is cloaked in the shadowy beauty of a gloss black body finish, with a black pickguard, black pickup covers and black controls.&nbsp;The Greasebucket Tone Circuit rolls off the highs without adding bass. Other details on this electric guitar include a vintage-style synchronized tremolo, all chrome hardware, and a large \'70s-style headstock and decal. </span></span></p><p><span id="docs-internal-guid-0f8a3de4-7fff-37a0-1e71-ffcd3ced9276"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-0f8a3de4-7fff-37a0-1e71-ffcd3ced9276"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-36ca85c6-7fff-5408-ef93-ea8e32828535" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender supplied a Gig Bag with this guitar originally, however we protected her in a custom ordered “tweed” hardshell case which is included.</span></span><br></span></span></p>',
            'text' => '<p><span id="docs-internal-guid-2ebe3986-7fff-5e4b-af10-3e9d17ceeab1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender introduces the American Special Series Stratocaster. Everything you want in an affordable U.S.-made guitar is within your reach. The American Special Series – guitars for the times.</span></span></p><p dir="ltr" style="line-height:1.3800000000000001;text-indent: 22.5pt;margin-top:0pt;margin-bottom:8pt;"><span style="font-size:11pt;font-family:Calibri,sans-serif;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;"><br></span></p><p dir="ltr" style="line-height:1.3800000000000001;text-indent: 22.5pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Stratocaster American Special 60th Anniversary at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Maple neck with modern "C" profile and satin finish</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Maple fingerboard with black pearloid inlays, and 22 medium jumbo frets</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Larger 70’s style headstock with “CBS” black logo</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Five-way pickup switching and tone control for middle and bridge pickups</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Two-point synchronized tremolo bridge with vintage-style stamped steel saddles</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Includes custom “tweed’ hardshell case with locks</span></p></li></ul><p><span id="docs-internal-guid-2ebe3986-7fff-5e4b-af10-3e9d17ceeab1"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-52f2a104-7fff-8104-5b89-01a5c2f973d9"></span></span></span><br></p>',
