            array (
                'id' => '42',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-B94U49QTFN',
                'name' => '2014 FENDER STRATOCASTER ‘RITCHIE BLACKMORE’ SIG. IN CLASSIC WHITE',
                'name_2' => 'Fender Stratocaster ‘Ritchie Blackmore’ Signature Classic White, 2014',
                'slug' => '2014-fender-stratocaster-ritchie-blackmore-sig-in-classic-white',
                'description' => '<p><span id="docs-internal-guid-58a6d713-7fff-9cfd-6cf8-a5b77597a905"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Blackmore has long preferred this kind of specially scalloped fingerboard, on which the effect starts lightly at the fourth or fifth fret on the low E, A and D strings and immediately on the G, B and high E strings, gradually becoming more pronounced toward the upper reaches of the fingerboard. The formidable tone of the Ritchie Blackmore Stratocaster comes from dual Seymour Duncan® Quarter Pound™ Flat SSL-4 single-coil Strat pickups, with reverse winding and reverse polarity on the bridge pickup for hum cancellation.</span></span></p><p><span id="docs-internal-guid-58a6d713-7fff-9cfd-6cf8-a5b77597a905"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-58a6d713-7fff-9cfd-6cf8-a5b77597a905"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-b933d2a6-7fff-f20a-c486-7320a65f3dc8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Ritchie Blackmore Stratocaster features a three-way pickup switch that gives you the bridge pickup alone, the bridge and neck pickups together, and the neck pickup alone. For Blackmore-esque guitar strap security and style, his signature Stratocaster features distinctive flush-mount Dunlop® Strap Locks. In an authentic nod to early-1970s Fender style, the Ritchie Blackmore Stratocaster has a three-screw neck plate stamped with the stylized capital “F” of the traditional Fender script logo. The neck plate also features the Micro-Tilt™ neck angle adjustment mechanism.</span></span></span></span></p><p><span id="docs-internal-guid-58a6d713-7fff-9cfd-6cf8-a5b77597a905"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-b933d2a6-7fff-f20a-c486-7320a65f3dc8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-58a6d713-7fff-9cfd-6cf8-a5b77597a905"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-b933d2a6-7fff-f20a-c486-7320a65f3dc8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-16922d96-7fff-7297-1151-6393bb0f1917"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deluxe Gigbag included by Fender. We have added a custom made “tweed” covered Hardshell Case for extra protection, included with purchase. You can be the first person to play this awesome and brand-spanking-new guitar!</span></span><br></span></span></span></span></p><p><br></p>',
            'text' => '<p><span id="docs-internal-guid-4282b8eb-7fff-b923-2436-92d7be42ea64"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Unmistakable Blackmore Style. A pioneering master of neo-classical heavy rock, metal godfather Ritchie Blackmore is the man who gave the world the most imitated Stratocaster riff ever ("Smoke on the Water"), and his deft phrasing and unmistakable tone helped make the extended guitar solo an essential art form in itself. The Ritchie Blackmore Stratocaster is based on his favorite \'70s model and puts artful Blackmore Strat® style in your hands with distinctive features and modifications, including a graduated fingerboard scalloping, special pickups and more.</span></span></p><p><span id="docs-internal-guid-4282b8eb-7fff-b923-2436-92d7be42ea64"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Ritchie Blackmore Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Maple neck with “U” profile and “bullet” truss rod</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Three-bolt “F”-stamped neck plate with Micro-Tilt™</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">7.25”-radius rosewood fingerboard with graduated scalloping and 21 vintage-style frets</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Seymour Duncan® Quarter Pound Flat™ SSL-4 single-coil neck and bridge pickups (bridge pickup reverse wound/reverse polarity)</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Non-active middle pickup</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage-style synchronized tremolo bridge</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom Tweed Hardshell Case included</span></p></li></ul><p><span id="docs-internal-guid-4282b8eb-7fff-b923-2436-92d7be42ea64"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-52a8539f-7fff-e0ea-7472-146c7a93b906"></span></span></span><br></p>',
