            18 => 
            array (
                'id' => '43',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-OZEZOO9GBB',
                'name' => '2015 FENDER ‘SERGIO VALLIN’ SIGNATURE IN OLYMPIC WHITE FINISH',
                'name_2' => 'Fender ‘Sergio Vallín’ Signature, Olympic White, 2015',
                'slug' => '2015-fender-sergio-vallin-signature-in-olympic-white-finish',
            'description' => '<p><span id="docs-internal-guid-483a0dfa-7fff-a81b-76ee-dcbc74896374"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Sergio Vallin Signature Guitar is one of two Stratocaster signatures added for 2015. Though not a classic Strat, Vallin`s signature double-cut has been listed under the Stratocaster signatures on Fender`s site. This curvaceous six-string is a solid and double-cut guitar with flat-top design and bolt-on neck construction. For 2015, Fender has assigned only two color options for this model: Olympic White and Black. Both feature glossy finish over the body and headstock, with satin finish in the back of the neck. Also, combined nickel/chrome hardware is used. On the top of the flat, asymmetrical body, Fender installs a tortoise shell pickguard (both color options feature a tortoise shell pickguard).</span></span></p><p><span id="docs-internal-guid-483a0dfa-7fff-a81b-76ee-dcbc74896374"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-483a0dfa-7fff-a81b-76ee-dcbc74896374"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-dc8d603b-7fff-cf52-f457-52b65bc22d3f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Pickups department is equipped with a selection of three passive pickups (humbucker in the bridge and two single-coils in the middle and neck positions). Master volume knob and a five-position pickup switch knob comprise the controls. Maple neck on Sergio Vallin Signature Guitar is attached to the body via a special five-bolt joint. Back of the neck is, as it`s been mentioned before, finished in satin urethane, while the top features a 22-fret rosewood fingerboard with medium jumbo frets, dot inlays and 1.685" wide synthetic bone nut. To wrap the specs list, Fender has assigned a set of sealed locking tuners to this outstanding six-shooter.</span></span></span></span></p><p><span id="docs-internal-guid-483a0dfa-7fff-a81b-76ee-dcbc74896374"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-dc8d603b-7fff-cf52-f457-52b65bc22d3f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-483a0dfa-7fff-a81b-76ee-dcbc74896374"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-dc8d603b-7fff-cf52-f457-52b65bc22d3f" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9c91d4b8-7fff-f237-b057-a15cd72f5c1a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender supplied a Gig Bag with this guitar originally, however we protect her in a custom ‘tweed’ hardshell case which is included.</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-9c9120b6-7fff-7ebf-3d1f-5e6328845280"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">A new silhouette with triple pickups and Latin flavor. Electrifying Mexican quartet “Mana” is the world\' biggest Latin rock band, thanks in no small part to the masterful guitar work of Sergio Vallin. Fender and Valln collaborated closely on the Sergio Vallín Signature guitar model, one of the most distinctive instruments in the Fender Artist series. With a brand-new offset body shape, tonally versatile HSS pickup layout with special switching, and other special appointments, it\' a bold new Fender design loaded with pure Vallin sound, personality and playability.</span></span></p><p><span id="docs-internal-guid-9c9120b6-7fff-7ebf-3d1f-5e6328845280"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Fender “Sergio Vallin” at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Alder body with extra-deep carve waist contour is very comfortable to play over long gigs and extremely resonant with long sustain and thick warm tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Modern “C” shaped Maple Neck with Rosewood fingerboard; focused mid-range, crisp highs and smooth playing feel</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender® 2-point Synchronized Tremolo/Vibrato, with 6 independent Block Saddles</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">HSS Configuration; Hotter-wound FSV Humbucker bridge pickup, and FSV Single-Coil Strat pickups with crystal-clear character</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Push/pull Volume sends signal through Humbucker bypassing Volume and Pickup Switch</span></p></li></ul><p><span id="docs-internal-guid-9c9120b6-7fff-7ebf-3d1f-5e6328845280"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-0b29826b-7fff-a5c1-848e-ab113c5a6af5"></span></span></span><br></p>',
