                'code' => 'PRD-DFNYEOFZRX',
                'name' => '2015 FENDER AMERICAN ELITE TELECASTER IN AUTUMN BLAZE METALLIC FINISH',
                'name_2' => 'Fender Telecaster ‘Elite’, Autumn Blaze Metallic, 2015',
                'slug' => '2015-fender-american-elite-telecaster-in-autumn-blaze-metallic-finish',
            'description' => '<p><span id="docs-internal-guid-e789f5e3-7fff-561f-286f-f5e9bca5d423"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">A Tele for the Modern Player. Fender\'s American Elite Telecaster solidbody electric guitar is a great instrument for pickers who love the classic platform but need a wider palette of tones. You\'ll get the familiar twang and cut Teles are known for, but without the 60-cycle hum, thanks to a pair of fourth-generation Fender Noiseless single-coil pickups. An S-1 switch adds new pickup voicings to the American Elite Tele. The 9.5"-14" compound fretboard radius ensures comfort while chording, and it flattens out up high for unimpeded string bending and vibrato. And the necks’ rolled fretboard edges feel like a well-worn guitar as soon as you open the case. An addition you\'re sure to appreciate is the belly and arm comfort contours on the body of the American Elite Telecaster.</span></span></p><p><span id="docs-internal-guid-e789f5e3-7fff-561f-286f-f5e9bca5d423"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-e789f5e3-7fff-561f-286f-f5e9bca5d423"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-c45ec357-7fff-791e-4fb6-a0ccd835b212"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar came to us in brand new and unplayed condition in original sealed Fender packaging forwarded on to us by another retailer as part of a large (dozen+) guitar consignment. There is a factory defect in the paint on the inside edge of the waist contour carve, that is hidden -in large part- behind the reflection of the high-gloss contoured edge. As such we are listing this guitar as is; brand new with a factory blemish, and offering her at less than our cost. Huge savings opportunity!</span></span></span></span></p><p><span id="docs-internal-guid-e789f5e3-7fff-561f-286f-f5e9bca5d423"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-c45ec357-7fff-791e-4fb6-a0ccd835b212"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-e789f5e3-7fff-561f-286f-f5e9bca5d423"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-c45ec357-7fff-791e-4fb6-a0ccd835b212" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-1628e74a-7fff-9a0b-bb7f-ce49af4632be"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The guitar includes her original ABS Elite Molded Case with TSA locks. This guitar looks and feels amazing, and you can be the first person to play it!</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-640e4eb9-7fff-55fe-8531-5124f15ca567"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Packed with a baker\'s dozen of innovations, the American Elite Telecaster is the original solidbody electric guitar reimagined for modern players who want bleeding-edge performance with timeless visual style. The future of workhorse guitar design, this Tele® guitar\'s stunning style, easy playing feel and flexible sound that meets any musical need, was made to tear it up on stage or in the studio.</span></span></p><p><b style="font-size: 16px; letter-spacing: normal; color: rgb(255, 214, 99); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;"><br></b></p><p><b style="font-size: 16px; letter-spacing: normal; color: rgb(255, 214, 99); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Arial, sans-serif;">Fender American Elite Telecaster at a glance</b><br></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Alder Body sports comfort belly and arm contours</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Compound profile neck; Ideal 9.5"−14" compound-radius fretboard with redesigned contoured neck heel and locking short-post tuning machines</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Two all-new fourth generation Noiseless single-coil Telecaster pickups</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">S-1™ switching switches between parallel and series pickup wiring which offers more sonic options</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:8pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Includes redesigned ABS Elite Molded Case with TSA locks</span></p></li></ul><p><span id="docs-internal-guid-640e4eb9-7fff-55fe-8531-5124f15ca567"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-5e442eca-7fff-79bf-67d4-d8059471883c"></span></span></span><br></p>',
