                'code' => 'PRD-2MB20GV1EF',
                'name' => '2016 FENDER JAGUAR JOHNNY MARR SIG ’65 JAG IN KANDY ORANGE METALLIC FINISH',
                'name_2' => 'Fender Jaguar \'65 ‘Johnny Marr’ Signature, Metallic Kandy Orange, 2016',
                'slug' => '2016-fender-jaguar-johnny-marr-sig-65-jag-in-kandy-orange-metallic-finish',
            'description' => '<p><span id="docs-internal-guid-db7fea3b-7fff-394c-5582-42365ec89b70"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Premium features include the classic Jaguar 24” scale length, lacquer-finished alder body, 7.25”-radius rosewood fingerboard with 22 vintage-style frets, custom-wound Bare Knuckle Johnny Marr single-coil neck and bridge pickups, master volume and tone controls, three-ply pickguard (white-black-white) and chrome hardware.</span></span></p><p><span id="docs-internal-guid-db7fea3b-7fff-394c-5582-42365ec89b70"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-db7fea3b-7fff-394c-5582-42365ec89b70"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-83ea84c6-7fff-56e8-8bda-e9a25e01657f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">"Making this signature Jaguar has been a four year journey,” “I\'ve taken all the aspects of the guitar in every direction I could, to improve it without losing the classic features that I liked from the original design. It\'s been a labour of love and obsession, and a privilege. I\'ve used it for everything I\'ve done since I started making it. It\'s my perfect guitar." -- Johnny Marr</span></span></span></span></p><p><span id="docs-internal-guid-db7fea3b-7fff-394c-5582-42365ec89b70"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-83ea84c6-7fff-56e8-8bda-e9a25e01657f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-db7fea3b-7fff-394c-5582-42365ec89b70"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-83ea84c6-7fff-56e8-8bda-e9a25e01657f" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-a54119c8-7fff-764e-228f-c6ea6f6d3fc5"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Accessories include a custom case with blue crushed velvet interior, strap, cable and flatwound strings.</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-ac51f0e1-7fff-2d85-4ae3-9f6f2702ba1e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Johnny Marr is best known as the strikingly dynamic guitarist-arranger-songwriter behind the Smiths, who redefined and ruled U.K. pop in the 1980s. A master of melody, layering and texture, Marr has brought his own instantly identifiable genius to the proceedings ever since, in stints with The Pretenders, Modest Mouse and the Cribs—to say nothing of his solo career and innumerable guest appearances. The Johnny Marr Jaguar is a fantastically non-standard model that is as distinctive as the sounds he wrings from it.</span></span></p><p><span id="docs-internal-guid-ac51f0e1-7fff-2d85-4ae3-9f6f2702ba1e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height:1.3800000000000001;margin-left: 22.5pt;margin-right: -18.2pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Fender Johnny Marr Signature ’65 Jaguar at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom-wound Bare Knuckle Johnny Marr single-coil neck and bridge pickups.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Custom-shaped maple neck based on Marr’s 1965 Jaguar, with vintage-style truss rod, lacquer finish and Marr’s signature on the front of the headstock.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Four-position blade-style pickup switch mounted to the lower-horn chrome plate (bridge, bridge and neck in parallel, neck, bridge and neck in series).</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Two upper-horn slide switches (universal bright and pickup switch position #four bright).</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Jaguar Bridge with Mustang saddles, nylon bridge post inserts for improved stability, chrome cover and vintage-style floating tremolo tailpiece.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">“Taller” tremolo arm with arm-sleeve nylon insert to prevent arm swing.</span></p></li></ul><p><span id="docs-internal-guid-ac51f0e1-7fff-2d85-4ae3-9f6f2702ba1e"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-45d88b4f-7fff-53ee-6a7a-f9ac4c7fc13a"></span></span></span><br></p>',
