                'code' => 'PRD-RP7HDGF05K',
                'name' => '2016 FENDER ERIC JOHNSON SIGNATURE STRATOCASTER IN LUCERNE AQUA FIREMIST',
                'name_2' => 'Fender Stratocaster ‘Eric Johnson’ Signature, Lucerne Aqua Firemist, 2016',
                'slug' => '2016-fender-eric-johnson-signature-stratocaster-in-lucerne-aqua-firemist',
            'description' => '<p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Any guitarist who marvels at the breathtaking sonic artistry and peerlessly pure tone of Texas Strat® virtuoso Eric Johnson will also marvel at the Eric Johnson Stratocaster guitar. Johnson is famously meticulous in crafting his tone, and every facet of the guitar is designed to Johnson\'s own detailed specs, from the specially voiced pickups to the extra-contoured neck and body to the distinctive tremolo assembly and much more. A refined signature model honoring one of modern music\'s finest Strat masters.</span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9b21f1fd-7fff-3410-c112-16d4650b3e94"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Eric Johnson Stratocaster RW guitar is built from some of the finest wood materials available. The light 2-piece alder body is dressed in a very thin nitrocellulose lacquer finish; the quartersawn maple neck is paired with a rosewood fingerboard with a 12" radius and 21 highly polished frets. Custom pickups wound to Eric\'s specifications are featured on the Eric Johnson Strat including staggered vintage-style machine heads (thus eliminating the need for a string tree), custom pickups with countersink screws and wound to Eric\'s specifications, and highly contoured body and neck.</span></span></span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9b21f1fd-7fff-3410-c112-16d4650b3e94"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9b21f1fd-7fff-3410-c112-16d4650b3e94"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cda85841-7fff-506c-192c-17fa783ef696"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Pickups Eric Johnson Plays; Eric Johnson possesses some of the most awe-inducing clean and driven electric guitar tones out there. It\'s his ceaseless quest to perfect that sound that has led Fender to release his signature set of three single-coil pickups. Special care was taken to reproduce the exact output and sweet tone Johnson is after, utilizing a mix of Alnico 3 and Alnico 5 staggered magnets. And the Eric Johnson Strat Pickup Set boasts a hotter bridge pickup to ensure you enjoy a balanced signal across all the pickup switching positions.</span></span></span></span></span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9b21f1fd-7fff-3410-c112-16d4650b3e94"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cda85841-7fff-506c-192c-17fa783ef696"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></span></span></p><p><span id="docs-internal-guid-856aee9d-7fff-17c6-5715-cca6fe79044c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-9b21f1fd-7fff-3410-c112-16d4650b3e94" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-cda85841-7fff-506c-192c-17fa783ef696"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-aefb9b26-7fff-748c-39b4-826c5e6f0e5a"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Eric Johnson Stratocaster RW comes with a parchment \'57-style pickguard, a 5-way pickup switch, master volume, neck tone and bridge tone controls, a vintage tremolo with a silver painted block, and a \'57-style string recess with no paint between base plate and the block.</span></span></span></span></span></span></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-99ad2a57-7fff-c4a2-db83-ce6c73705555"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Play Eric Johnson\'s Tone Machine of Choice. The Fender Eric Johnson Stratocaster RW solidbody electric guitar brings you an instrument fit for a guitar tone master! Eric is also known for his perfectionism and dedicated search for an ultimate guitar. The brainchild of Johnson himself, the Eric Johnson Stratocaster RW is designed with Eric\'s own personal features and preferences, and it is made possible because of his expressed desire to give something back to the collectors, players, and especially the fans who have supported him throughout his career.</span></span></p><p><span id="docs-internal-guid-99ad2a57-7fff-c4a2-db83-ce6c73705555"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.38; margin-left: 22.5pt; margin-top: 0pt; margin-bottom: 8pt; padding: 0pt 0pt 0pt 13.5pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Eric Johnson Signature Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Made with the finest woods available</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deep-contoured, \'57-style alder body</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Quartersawn maple neck with 21 highly polished medium-jumbo frets</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Specially made (rare) Fender bound rosewood fingerboard with 12" radius</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">3 Fender Custom Shop </span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">special-design Eric Johnson single-coil pickups</span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"> wound to Eric\'s specifications</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage tremolo with \'57-style string recess</span><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Staggered vintage-style machine heads eliminate the need for a string-tree aiding tuning stability</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Deluxe blonde hardshell case included with brown ends (plush gold interior) and locks</span></p></li></ul><p><span id="docs-internal-guid-99ad2a57-7fff-c4a2-db83-ce6c73705555"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-819e2cf6-7fff-2929-7992-936e8dbfa9d1"></span></span></span><br></p>',
