                'brand_id' => '13',
                'code' => 'PRD-OHZ45TJ2X0',
                'name' => '2016 FENDER STRATOCASTER ‘JOHN MAYER’ SIGNATURE IN 3-COLOR SUNBURST FINISH',
                'name_2' => 'Fender Stratocaster ‘John Mayer’ Signature, 3-tone Sunburst, 2016',
                'slug' => '2016-fender-stratocaster-john-mayer-signature-in-3-color-sunburst-finish',
                'description' => '<p><span id="docs-internal-guid-1b0f0411-7fff-b152-6c06-600f749f9f65"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">No one has galvanized younger blues and pop guitarists quite like John Mayer in the last two decades. His tasteful playing, outsize personality and ranging styles of songwriting have kept him in the conversation for a long time. At the center of any Mayer talk is always the tone—pure, glassy, smooth, and saturated at times. Part of that is his use of Dumble and Two Rock amps, but another part was the unique, mid-scooped Big Dipper pickups in his now-discontinued signature Fender John Mayer Stratocaster. While Mayer has moved onto to PRS and the&nbsp;Silver Sky model, these earlier signature Fenders are still excellent instruments that demand the attention of any Mayer fan.</span></span></p><p><span id="docs-internal-guid-1b0f0411-7fff-b152-6c06-600f749f9f65"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-1b0f0411-7fff-b152-6c06-600f749f9f65"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-d3b5c820-7fff-d25a-adcc-5ed880f4b1f2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Thick C-Shape Neck, Vintage Hardware, Five Tremolo Springs installed at Factory, Per the Artist\'s Request, the Back Tremolo Cover Plate is Not Installed nor Included with the Guitar, String Tree is Farther from the Nut, 3 Big Dipper Single-Coil Strat Pickups with Special "Scooped" Mid-range Voicing to Meet John Mayer\'s Specifications, \'50s Spaghetti Logo Decal, Satin Urethane Finish on Back of Neck, Gloss Finish on the Face of the Headstock.</span></span></span></span></p><p><span id="docs-internal-guid-1b0f0411-7fff-b152-6c06-600f749f9f65"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-d3b5c820-7fff-d25a-adcc-5ed880f4b1f2"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-1b0f0411-7fff-b152-6c06-600f749f9f65"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-d3b5c820-7fff-d25a-adcc-5ed880f4b1f2" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-f84e7827-7fff-f3d7-7a5a-89c8f2d17080"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in brand new condition, and you can be the first person to play it!</span></span><br></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-7acce8e9-7fff-afd9-6c1d-26ac80a0c32e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Grammy award winner John Mayer teamed with Fender to create his must-have signature instrument. The John Mayer Stratocaster guitar features an alder body, satin urethane-finished maple neck with a slightly larger C shape, 9.5"-radius African rosewood fingerboard with Dunlop 6105 frets, and buffed headstock with vintage-style ´50s decal and string tree placed slightly farther from the nut.</span></span></p><p><span id="docs-internal-guid-7acce8e9-7fff-afd9-6c1d-26ac80a0c32e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-right: -18.2pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>John Mayer Signature Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Lightweight Alder body is extremely resonant with long sustain and thick warm tones</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Satin Urethane Finished thick C-Shape Maple Neck with African Rosewood fingerboard and polished Dunlop 6105 frets; focused mid-range, crisp highs and smooth playing feel</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender/Gotoh vintage-style tuners</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American vintage synchronized tremolo with five Tremolo Springs installed at Factory&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">3 Big Dipper Single-Coil Strat Pickups with Special "Scooped" Mid-range Voicing</span></p></li></ul><p><span id="docs-internal-guid-7acce8e9-7fff-afd9-6c1d-26ac80a0c32e"><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: p