            array (
                'id' => '48',
                'category_id' => '8',
                'brand_id' => '13',
                'code' => 'PRD-2SPN2HNTZ6',
                'name' => '2016 FENDER TELECASTER AMERICAN STANDARD LTD ED IN OLYMPIC WHITE FINISH',
                'name_2' => 'Fender Telecaster American Standard Ltd Ed, Olympic White, 2016',
                'slug' => '2016-fender-telecaster-american-standard-ltd-ed-in-olympic-white-finish',
            'description' => '<p><span id="docs-internal-guid-7fb33655-7fff-1520-b935-0278ecd5ea47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">2016 Limited Edition American Standard Telecaster Matching Headstock is one of the latest limited edition models introduced into the Fender catalog. Key features include: flat-top alder body, bolt-on maple neck with C profile, 22-fret rosewood fingerboard (medium jumbo frets, dot inlays, and 1.685" nut), modern Tele bridge and Fender tuning machines. American Vintage `58 Single-Coil Tele pickups replace the stock American Standard single-coils, delivering that classic late 50`s tone.</span></span></p><p><span id="docs-internal-guid-7fb33655-7fff-1520-b935-0278ecd5ea47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-7fb33655-7fff-1520-b935-0278ecd5ea47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bb0cb7d8-7fff-38a3-0294-a00d5e5d0e1e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The Olympic White color scheme with gloss polyurethane finish and matching headstock is a top-of-the-line limited color option. Fender U.S.A. Deluxe form-fit molded case is included.</span></span></span></span></p><p><span id="docs-internal-guid-7fb33655-7fff-1520-b935-0278ecd5ea47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bb0cb7d8-7fff-38a3-0294-a00d5e5d0e1e"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-7fb33655-7fff-1520-b935-0278ecd5ea47"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-bb0cb7d8-7fff-38a3-0294-a00d5e5d0e1e" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-77ed6734-7fff-53b0-8603-344fbcd1d17b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in brand new and unplayed condition the same as when it left the factory. You can be the first person to play this awesome Limited Edition Tele!</span></span></span></span><br></span></span><br></p>',
            'text' => '<p><span id="docs-internal-guid-f10f66e7-7fff-0c31-7dc5-b130ac8cd48b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American Standard series embodies the spirit of Fender in its full glory. It features top shelf materials, some of the finest pieces of Fender hardware and iconic Fender® Custom Shop Vintage ’58 pickups and Limited Edition matching Olympic White Headstock.</span></span></p><p><span id="docs-internal-guid-f10f66e7-7fff-0c31-7dc5-b130ac8cd48b"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>2016 Limited Edition American Standard Telecaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Designed for long playing sessions, the Limited Edition American Standard Telecaster features a lightweight Alder body&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Uncommon and attractive looks provided by the Olympic white color sc