            'text' => '<p><span id="docs-internal-guid-7359d6f0-7fff-4cd0-359d-3eeee1eb8ad8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The American Vintage Series introduces an all-new lineup of original-era model year guitars that bring Fender history and heritage to authentic and exciting new life. With key features and pivotal design elements spanning the mid-1950s to the mid-1960s, new American Vintage series instruments delve deep into Fender´s roots-expertly preserving an innovative U.S. guitar-making legacy and vividly demonstrating like never before that Fender not only knows where it´s going, but also remembers where it came from.</span></span></p><p><span id="docs-internal-guid-7359d6f0-7fff-4cd0-359d-3eeee1eb8ad8"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p dir="ltr" style="line-height: 1.295; margin-left: 18pt; margin-top: 0pt; margin-bottom: 8pt; padding: 0pt 0pt 0pt 22.5pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>American Vintage Series \'52 Telecaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Premium lightweight Ash body, has slightly lighter Butterscotch Blonde finish</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">One-piece maple neck with U-shape profile, 7.25"-radius fingerboard with comfortably rolled edges</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender-Gotoh Deluxe vintage-style tuners</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage-style Tele bridge with compensated brass saddles allow for more accurate intonation</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American Vintage Tele single-coil pickups wound to period-correct specs and sound</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.38000000000