                'code' => 'PRD-MNKUR68JYW',
                'name' => '2016 FENDER TELECASTER ‘JAMES BURTON’ SIGNATURE IN RED PAISLEY FLAME FINISH',
                'name_2' => 'Fender Telecaster ‘James Burton’ Signature, Red Paisley Flame, 2016',
                'slug' => '2016-fender-telecaster-james-burton-signature-in-red-paisley-flame-finish',
                'description' => '<p><span id="docs-internal-guid-f9c71e44-7fff-f1bb-39a6-7d40858bf5aa"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">An original Telecaster Master still going strong, James Burton influenced generations of rock guitar royalty with his perfectly phrased late−\'50s early−\'60s Tele® work with Ricky Nelson, and his later stints with Elvis Presley, Emmylou Harris, Elvis Costello and many others only furthered his revered elder-statesman status. His was the first signature Fender Telecaster model, and today\'s James Burton Telecaster is as fiery as ever, with three pickups, special switching, gold hardware, gorgeous paisley-flame finishes and more.</span></span></p><p><span id="docs-internal-guid-f9c71e44-7fff-f1bb-39a6-7d40858bf5aa"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-f9c71e44-7fff-f1bb-39a6-7d40858bf5aa"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-4fcc0ef6-7fff-0fae-c993-b207d6fbc11d" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in brand new and unplayed condition. You can be the first person to play it!</span></span><br></span></span><br></p>',
                'text' => '<p dir="ltr" style="line-height:1.295;margin-left: 18pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Fender James Burton Signature Telecaster at a glance</b></span></font></p><p><span id="docs-internal-guid-f766e4d3-7fff-4053-6ad1-1a48b9112ce7"></span></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Basswood body contributes to a defined sound that cuts through a mix well, with nice warmth and midrange and even a slightly growling tone&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">’60s "U" neck profile feels fuller to the fretting hand with more mass for improved tone and sustain&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Three specially voiced single-coil pickups in accordance with JB’s specifications</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Five way "Strat-o-Tele" switching that delivers the neck pickup alone, the bridge pickup alone, and three different parallel dual-pickup combinations&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Hard-tail string-through-body Stratocaster Bridge for rock-solid intonation and tuning stability&nbsp;&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height:1.3800000000000001;margin-right: -22.7pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">S-1 switch on the James Burton Telecaster introduces series circuitry for pickup switch positions two and four.</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;" aria-level="1"><p dir="ltr" style="line-height: 1.38; margin-right: -22.7pt; margin-top: 0pt; margin-bottom: 0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Comes with Original Fender Vintage Tweed Hardshell Case</span></p></li></ul>',
