                'slug' => '2017-fender-custom-shop-namm-ltd-roasted-56-stratocaster-in-vintage-blonde-finish',
                'description' => '<p><span id="docs-internal-guid-b5ee3526-7fff-287f-787e-963de38360a1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This finely crafted guitar has some excellent specs.&nbsp;Roasted maple neck and lightweight Ash body with NOS Nitro lacquer finish, all hand-wound Pickups; 1969 Neck, Reverse-Wound/Reverse-Polarity 1969 Middle and Texas Special Bridge Pickups. This artisan class wiring offers bold tone with transparent bell-like bloom. And when dialed in using the Greasebucket tone circuit; reduces treble loss when adjusting the instrument’s volume. It also smooths the control tapers, avoiding the typical hotspots when adjusting your volume or tone.</span></span></p><p><span id="docs-internal-guid-b5ee3526-7fff-287f-787e-963de38360a1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-b5ee3526-7fff-287f-787e-963de38360a1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-5197258a-7fff-48ae-4ece-3c657af947cb"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">The sound of Woodstock; Fender Custom Shop \'69 Stratocaster pickups produce one of the most revered guitar sounds in popular music history-the full, punchy late-\'60s blues rock tone that ruled the era from Monterey on the West Coast to Woodstock on the East Coast. Because of the clarity and transparency created by the unique coil wind and magnet structure, the \'69 pickup design works especially well with pedals allowing the low end to thump and the high end to soar.</span></span></span></span></p><p><span id="docs-internal-guid-b5ee3526-7fff-287f-787e-963de38360a1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-5197258a-7fff-48ae-4ece-3c657af947cb"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-b5ee3526-7fff-287f-787e-963de38360a1"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-5197258a-7fff-48ae-4ece-3c657af947cb" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-adcaf9e7-7fff-7027-456a-de223c08c437" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">This guitar is in brand new, pristine condition and only taken out of the case once for our as-received inspection and then once again for our in-house photography. The original shipping box is also available. The guitar includes a wealth of unopened in-case extras and accessories. You can be the first person to play this guitar!</span></span></span></span></span></span></p>',
            'text' => '<p><span id="docs-internal-guid-f572e8c1-7fff-a0d7-d014-ae8067052a5f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Such a great example of what Fender Custom Shop is all about. Her sweet Roasted Birdseye Maple neck not only adds to her amazing tone but also creates a neck that is ultra-stable. This beauty will play and sound fantastic for years to come. Let Her Rip, Baby!</span></span></p><p><span id="docs-internal-guid-f572e8c1-7fff-a0d7-d014-ae8067052a5f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-f572e8c1-7fff-a0d7-d014-ae8067052a5f"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Fender Custom Shop NAMM Ltd Roasted ‘56 Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">NOS Lacquer Finish; over lightweight Ash Body&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Roasted AAA Grade Birdseye Maple Neck with 10/56 “V” Back-Shape&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Compound 9.5”-12” Radius Fingerboard with 22 #6105 Frets&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Hand-Wound 1969 Neck Pickup, Hand-Wound Reverse-Wound/Reverse-Polarity 1969 Middle Pickup, and Hand-Wound Texas Special Bridge Pickup&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Hand-wired end-to-end with Master Volume, Master Tone and Strat Fat 50’s Hookup Wiring with Greasebucket tone control for bridge pickup&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Classic appointments; Gold Tuning Machines with Pearl Buttons and bone nut&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 9pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-right: -18.2pt;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Limited Edition Engraved Neckplate, and Limited Edition Certificate of Authenticity </span></p></li></ul><p><span><span style="font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"></span></span><br></p>',
