                'code' => 'PRD-3W9MXLA1GU',
                'name' => '2017 FENDER STRATOCASTER \'65 AVRI IN LTD. ED. BURGUNDY MIST FINISH',
                'name_2' => 'Fender Stratocaster American Vintage \'65 Ltd Ed, Burgundy Mist Metallic, 2017',
                'slug' => '2017-fender-stratocaster-65-avri-in-ltd-ed-burgundy-mist-finish',
                'description' => '<p><span id="docs-internal-guid-26fa6c1f-7fff-17f5-7d2a-7828e756a1af"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Spot-on Reproduction of a 1965 Strat. With your hands on the Fender American Vintage \'65 Stratocaster solidbody electric guitar, you\'ll understand why 1965 was a memorable year for the iconic Strat. Fender based the American Vintage Series on actual vintage guitars from their past to bring you a period-correct \'65 Strat that plays like a modern classic. The American Vintage \'65 Stratocaster is built just like a 1965 original: you get an alder body, a mid-\'60s C-shaped maple neck, a round-lam rosewood fingerboard, and vintage-style appointments throughout. And with a trio of specially voiced American Vintage \'65 Grey Bottom Strat single-coil pickups, your favorite amplifier will love the Fender American Vintage \'65 Stratocaster as much as you do.</span></span></p><p><span id="docs-internal-guid-26fa6c1f-7fff-17f5-7d2a-7828e756a1af"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-26fa6c1f-7fff-17f5-7d2a-7828e756a1af"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8447dc49-7fff-2fb2-650b-9fe3a9fce576"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">To make it as vintage accurate as possible, Fender restored original tooling dies, voiced new pickups, and even reformulated vintage finishes based on actual vintage examples. The result is a guitar that not only looks accurate - it feels like you\'re playing a well-worn-in classic that\'s been waiting to be rediscovered. Fender chose to include 1965 models in their American Vintage Series, because it was an especially innovative year for the Stratocaster. It was the year that the Strat saw the return of the thicker C-shaped neck and introduced enamel-covered pickup wiring. This American Vintage \'65 Strat boasts all of these, plus a round-lam rosewood fretboard, making it a perfect reproduction of a 1965 Strat.</span></span></span></span></p><p><span id="docs-internal-guid-26fa6c1f-7fff-17f5-7d2a-7828e756a1af"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8447dc49-7fff-2fb2-650b-9fe3a9fce576"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p><span id="docs-internal-guid-26fa6c1f-7fff-17f5-7d2a-7828e756a1af"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-8447dc49-7fff-2fb2-650b-9fe3a9fce576" style=""><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-ba1d63e1-7fff-53b3-9be2-c42a96edd245"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Comes with Vintage \'65 Strat strap, cable, cloth, vintage 3-position switch, \'60s Strat information kit, bridge cover, owner\'s manual, and saddle height wrench and Deluxe Vintage Black hard case.</span></span></span></span></span></span><br></p>',
                'text' => '<p><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>Play a sweet blast from the past: the Fender American Vintage \'65 Stratocaster!</b></span></font></p><p><span id="docs-internal-guid-2f0ffc9f-7fff-ebaf-25ff-6ffd3969ce7c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></p><p><span id="docs-internal-guid-2f0ffc9f-7fff-ebaf-25ff-6ffd3969ce7c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-5189f766-7fff-16f7-55af-a33d0f12521c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">For the guitarist who craves pure vintage Fender style, the American Vintage series presents original-era model year guitars built with meticulous attention to accurate detail that bring Fender history and heritage to authentic and exciting new life.</span></span></span></span></p><p><span id="docs-internal-guid-2f0ffc9f-7fff-ebaf-25ff-6ffd3969ce7c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-5189f766-7fff-16f7-55af-a33d0f12521c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><br></span></span></span></span></p><p dir="ltr" style="line-height:1.295;margin-left: 22.5pt;margin-top:0pt;margin-bottom:8pt;"><font color="#ffd663" face="Open Sans, Helvetica Neue, Arial, sans-serif"><span style="font-size: 16px; letter-spacing: normal;"><b>American Vintage \'65 Stratocaster at a glance</b></span></font></p><ul style="margin-top:0;margin-bottom:0;padding-inline-start:48px;"><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">American Vintage Series Stratocaster that\'s based on the design of original 1965 Strats</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Vintage-style Flash Coat Lacquer finish is thinner than modern finishes, allowing the alder body to breathe and enhance tonally as it ages</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Thicker C-shaped neck satisfies players with a preference for larger necks and is true to 1965-style Strats</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">3 specially voiced American Vintage \'65 Grey Bottom Strat single-coil pickups are wound to match the sound and specs of original \'65 pickups</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Aged plastic knobs and switch caps complete the vintage look</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Limited Edition Color Finish&nbsp;</span></p></li><li dir="ltr" style="list-style-type: disc; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; margin-left: 4.5pt;" aria-level="1"><p dir="ltr" style="line-height:1.295;margin-top:0pt;margin-bottom:0pt;" role="presentation"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;">Fender® U.S.A. Vintage-authentic G&amp;G Hardshell Case</span></p></li></ul><p><span id="docs-internal-guid-2f0ffc9f-7fff-ebaf-25ff-6ffd3969ce7c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span style="" id="docs-internal-guid-5189f766-7fff-16f7-55af-a33d0f12521c"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;"><span id="docs-internal-guid-3d1e730f-7fff-3c12-9e5b-61b38ed1c5cc"></span></span></span><br></span></span><br></p>',
